import React, { Component } from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom"

export default class App extends Component {
  render() {
    return (
      <>
        <BrowserRouter>
          <Routes>
            <Route path='/home' element={<h2>Home Page</h2>}/>
          </Routes>
        </BrowserRouter>
      </>
    );
  }
}
